/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import right from '../image/list/right.png';
import '../share.css';
export default class ListItem extends React.Component {
    render(){
        const {leftIcon,leftTitle,rightTitle,rightIcon,isNotRightIcon} = this.props;
        return(
            <div className="cm-flex cm-jc-sb cm-width-full">
                <div className="cm-flex cm-ai-c">
                    {leftIcon?<img src={leftIcon} alt="" className="cm-img-small-icon"/>:null}
                    <span className="cm-c-333 cm-ml-05">{leftTitle}</span>
                </div>
                <div className="cm-flex cm-ai-c"><span className="cm-c-999">{rightTitle}</span>
                    {isNotRightIcon?null:
                        rightIcon?<img src={rightIcon} alt="" className="cm-img-small-icon"/>:<img src={right} alt="" className="cm-img-small-icon"/>
                    }
                </div>
            </div>
        )
    }
}
